import React from 'react';
import color from './backRespaldo.png';

const ColorDeFondo = () => {
    return (
            <defs>
                <pattern id="img1" patternUnits="userSpaceOnUse" width="1" height="1">
                    <image  xlinkHref={color} x="0" y="0" width="150" height="150" />
                </pattern>
            </defs>
    )
}

export default ColorDeFondo;
